import React from "react";

const ListItem= {
    color: "red",
    fontSize: "72px"
}

function EmployeeListItems(props) {
  return (
    <div className="ListItems">
        <h3>{props.name}</h3>
        <p>{props.Title}</p>
        <h3 style = {ListItem}></h3>

        </div>
  );
}


export default EmployeeListItems;
